import React from "react";
import "./Card.css";

const Card = (props) => {
  return (
    <div className="card text-center">
      <h4 className="card-title">{props.title}</h4>
      <img className="serviceImage" src={props.imgsrc}>
      <h4 className="card-title">{props.title}</h4>
      </img>
        <p className="card-text text-secondary">{props.p}</p>
    </div>
  );
};

export default Card;
